import {Router} from 'express'
import pkg from "../../package.json" ;

const router = Router()

router.get('/', (req, res) => {
    res.json({
        message: "Welcome to my Restaurante API",
        name: pkg.name,
        author: pkg.author,
        description: pkg.description,
        version: pkg.version,
    });
});

export default router
